    public int checkAppInfo(int newVersion) {
        SQLiteDatabase db = this.getReadableDatabase();
        Cursor cursor = db.rawQuery("SELECT * FROM " + APP_TABLE + " WHERE " + APP_ID + " = '1'", null);
        if (cursor.moveToFirst()) {
            if (cursor.getInt(2) != newVersion && cursor.getInt(1) == 0)
                return 1;
            else if (cursor.getInt(2) != newVersion && cursor.getInt(1) == 1)
                return 2;
        }
        cursor.close();
        return 0;
    }

