    public boolean isUserTableEmpty() {

        SQLiteDatabase db = this.getReadableDatabase();

        boolean returnValue;
        Cursor userCursor = db.rawQuery("SELECT COUNT(*) FROM " + USER_TABLE, null);

        userCursor.moveToFirst();
        if (userCursor.getInt(0) > 0) {
            userCursor.close();
            returnValue = false;// there are rows in the table
        } else {
            userCursor.close();
            returnValue = true;// there are no rows in the table
        }
        return returnValue;
    }

