    public CityModal citySelectRow(String provinceID, String city) {

        SQLiteDatabase db = this.getReadableDatabase();
        Cursor cursor = db.rawQuery("SELECT * FROM " + CITIES_TABLE + " WHERE " + CITY_NAME + " = '" + city + "' AND " +
                PROVINCE_ID + " = '" + provinceID + "'", null);

        CityModal cityModal = new CityModal();

        if (cursor.moveToFirst()) {
            cityModal.setCityID(cursor.getInt(0));
            cityModal.setProvinceID(cursor.getInt(1));
            cityModal.setCityName(cursor.getString(2));
            cityModal.setStatisticCode(cursor.getInt(3));
        }
        cursor.close();
        return cityModal;
    }

    public String readCityNameFromID(String ID) {

        SQLiteDatabase db = this.getReadableDatabase();
        Cursor cursor = db.rawQuery("SELECT * FROM " + CITIES_TABLE + " WHERE " + CITY_ID + " = '" + ID + "'", null);

        String city = "";
        if (cursor.moveToFirst()) {
            city = cursor.getString(2);
        }

        cursor.close();
        return city;

    }

    public ArrayList<String> readCitiesNames(ProvinceModal province) {

        SQLiteDatabase db = this.getReadableDatabase();
        Cursor cursor = db.rawQuery("SELECT * FROM " + CITIES_TABLE + " WHERE " + PROVINCE_ID + " = '" + province.getProvinceID() + "'", null);

        ArrayList<String> cities = new ArrayList<>();

        if (cursor.moveToFirst()) {
            do {
                cities.add(cursor.getString(2));
            } while (cursor.moveToNext());
        }
        cursor.close();
        return cities;
    }

