    public String readSectionsID(String cityID, String section) {

        SQLiteDatabase db = this.getReadableDatabase();

        Cursor cursor = db.rawQuery("SELECT * FROM " + SECTIONS_TABLE + " WHERE " + CITY_ID + " = '" + cityID + "' AND " +
                SECTION_NAME + " ='" + section + "'", null);

        String sectionString = "";
        if (cursor.moveToFirst()) {
            do {
                sectionString = cursor.getString(0);
            } while (cursor.moveToNext());
        }
        cursor.close();
        return sectionString;
    }

    public String readSectionNameFromID(String ID) {

        SQLiteDatabase db = this.getReadableDatabase();

        Cursor cursor = db.rawQuery("SELECT * FROM " + SECTIONS_TABLE + " WHERE " + SECTION_ID + " = '" + ID + "'", null);

        String sectionString = "";
        if (cursor.moveToFirst()) {
            do {
                sectionString = (cursor.getString(1));
            } while (cursor.moveToNext());
        }
        cursor.close();
        return sectionString;
    }

    public ArrayList<String> readSectionsNames(CityModal city) {

        SQLiteDatabase db = this.getReadableDatabase();

        Cursor cursor = db.rawQuery("SELECT * FROM " + SECTIONS_TABLE + " WHERE " + PROVINCE_ID + " = '" + city.getProvinceID() + "'" +
                " AND " + CITY_ID + " = '" + city.getCityID() + "'", null);

        ArrayList<String> sections = new ArrayList<>();

        if (cursor.moveToFirst()) {
            do {
                sections.add(cursor.getString(1));
            } while (cursor.moveToNext());
        }
        cursor.close();
        return sections;
    }

