    public ArrayList<PlanModal> loadSearchedPlans(String name, String family, String nationalCode, String userID, int isCompleted) {

        SQLiteDatabase db = this.getReadableDatabase();

        String query = "SELECT * FROM " + PLANS_TABLE + " WHERE ";
        if (!name.isEmpty())
            query += NAME + " LIKE '%" + name + "%' AND ";
        if (!family.isEmpty())
            query += FAMILY_NAME + " LIKE '%" + family + "%' AND ";
        if (!nationalCode.isEmpty())
            query += NAT_CODE + " = " + nationalCode + " AND ";

        query += IS_COMPLETED + " = " + isCompleted + " AND " + PLAN_USER_ID + " = " + userID + " ORDER BY " + PLAN_PINNED_POSITION + " ASC";

        Cursor planCourses = db.rawQuery(query, null);

        ArrayList<PlanModal> planModalArrayList = new ArrayList<>();

        if (planCourses.moveToFirst()) {
            do {
                planModalArrayList.add(new PlanModal(planCourses.getString(0), planCourses.getString(1), planCourses.getString(2),
                        planCourses.getString(3), planCourses.getString(4), planCourses.getString(5), planCourses.getString(6),
                        planCourses.getString(7), planCourses.getString(8), planCourses.getString(9), planCourses.getString(10),
                        planCourses.getString(11), planCourses.getString(12), planCourses.getString(13), planCourses.getString(14),
                        planCourses.getString(15), planCourses.getString(16), planCourses.getString(17), planCourses.getString(18),
                        planCourses.getString(19), planCourses.getString(20), planCourses.getString(21), planCourses.getString(22),
                        planCourses.getString(23), planCourses.getString(24), planCourses.getString(25), planCourses.getString(26),
                        planCourses.getString(27), planCourses.getInt(28), planCourses.getString(29), planCourses.getString(30),
                        planCourses.getString(31), planCourses.getString(32), planCourses.getString(33), planCourses.getString(34),
                        planCourses.getString(35), planCourses.getString(36), planCourses.getString(37), planCourses.getString(38),
                        planCourses.getInt(39), planCourses.getInt(40), planCourses.getString(41), planCourses.getInt(42),
                        planCourses.getInt(43), planCourses.getString(44), planCourses.getString(45), planCourses.getInt(46)));
            } while (planCourses.moveToNext());
        }
        planCourses.close();
        return planModalArrayList;
    }

